import axios from 'axios'



export function Row({user}) {
    return(
        <tr>
            <td><img src="user.picture.thumbnail" height="50" width="50"/> </td>
            <td>{this.props.name.first} {user.name.last}</td>
            <td>{this.props.email}</td>
            <td>{this.props.phone}</td>
        </tr>
    )

}
